import { TComponentGroup } from "~/interfaces/material_components";

const componentGroup: TComponentGroup = {
  iconType: "user",
  title: "Data Display",
  components: [
    { title: "Avatar", props: [] },
    { title: "Badge", props: [] },
    { title: "Chip", props: [] },
    { title: "Divider", props: [] },
    { title: "Icons", props: [] },
    { title: "Material Icons", props: [] },
    { title: "List", props: [] },
    { title: "Table", props: [] },
    { title: "Tooltip", props: [] },
    { title: "Typography", props: [] }
  ]
};

export default componentGroup;
